    "input": {
        height: 48,
        width: 300
    }
})
const Input = (props) => {
    return (
        <TextFiled
            className={"TextFiled"}
            fullWidth={props.fullWidth}
            label={props.label}
            margin="dense"
            multiline={props.multiline}
            required={props.required}
            rows={props.rows}
            value={props.value}
            type={props.type}
            onChange={props.onChange}

        />
    )
}

export default Input
